import { Footer } from "./Component/Footer";
import { Header } from "./Component/Header";
import Todo from "./Component/Todo";

function App(todo) {
  return (
    <div className="App">
      <section className="todoapp">
        <Header/>
        <Todo todo={todo}/>
      </section>
    <Footer/>
    </div>
  );
}

export default App;
